import { Link, Outlet } from "react-router-dom";
import { useLocation } from "react-router-dom";


function Administracija(){
    const {state } = useLocation();
    const {username} = state;
    console.log(username);
    console.log();
    return(
        <>
        <nav className='navbar navbar-expand-md justify-content-between bg-primary'>
            <ul className="navbar-nav">
                <li className="nav-item">
                    <Link className='btn text-white' to={{pathname:"klijenti",state: {username: {username} }}}>Klijenti</Link>
                </li>
                <li className="nav-item">
                    <Link className='btn text-white' to={{pathname:"racuni",state: {username: {username} }}}>Racuni</Link>
                </li>
                <li className="nav-item">
                    <Link className='btn text-white' to={{pathname:"zaposlenici",state: {username: {username} }}}>Zaposlenici</Link>
                </li>
            </ul>
            <div className="navbar-nav ml-auto">
                <Link className='btn text-white' to="/Login">Odjava</Link>       
            </div>    
        </nav>
        <Outlet />
        </>
    );
}

export default Administracija;
